  input: 'TEXT,SA11A1,SA11A1.4603,"March 28, 2002 - Federal Election Commission -
    Attention Jim Krebs-Reports Analyst Reports Analyst Division - Identification
    Number:  C00326736 --  RE: Explanation for Amending Mid-Year Report (1/1/01-6/30/01)                                                            The
    following explanation is being submitted in response to a letter from the FEC
    dated March 13, 2002 concerning ''limited payment for administrative expenses.''
    The Renal Leadership Council PAC does have very limited administrative expenses
    because the PAC is administered as part of a broad contract of services provided
    by Congressional Consultants (CC) for the Renal Leadership Council (RLC).  Services
    to administer the PAC by CC on behalf of the RLC are not broken out or separately
    reimbursed by the RLC.  Instead, the RLC pays a global monthly fee to CC for a
    broad range of government relations services.  The RLC is not a formal organization.
    CC spends very little time administering the PAC. Having talked to Jim Krebs it
    was decided that in lieu of listing a salary, as one is not paid for administering
    the PAC, that the RLC should list an in-kind contribution to the RLC PAC for the
    administration of the PAC. As a result, the Mid-Year Report has been amended to
    show a $600 in-kind contribution from the RLC to the RLC PAC. -- Gwen Gampel,
    Treasurer, RLC PAC"'
